import React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';


const Header = () => {
  return (
    <div className="App">
        <Stack spacing={8} direction="row">
            <h2>Destinations</h2>
            <Button variant="contained">Text</Button>
        </Stack>
    </div>
  );
}

export default Header;
